description:
Verenigde Staten
Horror
91 minuten

goed

met Katie Parker, Courtney Bell en Dave Levine

Tricia's man wordt al zeven jaar vermist. Haar jongere zus Callie trekt bij haar in wanneer ze hem uiteindelijk dood verklaren. 
Tricia wil het niet geloven en blijft hoop houden maar Callie is realistischer en wil dat ze verder gaat met haar leven. Als 
Tricia haar leven weer op probeert te pakken voelt Carrie zich aangetrokken tot een lugubere tunnel bij het huis. Als ze het 
begint te linken met andere mysterieuze verdwijningen wordt het duidelijk dat zijn ogenschijnlijke dood niet zo natuurlijk is. 
Al snel wordt het duidelijk dat een eeuwenoude kracht in de tunnel zijn zinnen heeft gezet op Callie en Tricia en dat Tricia's 
man misschien wel een veel slechter lot heeft getroffen dan de dood.
